  input: TEXT,F3A,,"This report is amended to disclose contributor employer and occupation
    information received in response to the Committee's 'best efforts' requests.  The
    Committee meets the Commission's 'best efforts' standards by 1) requesting employer
    and occupation information when contributions are solicited, 2) sending a written
    request for missing information shortly after receiving contributions, and 3)
    amending reports to disclose information received.  All requests for employer
    and occupation information notify the contributor that the information is required
    by federal law.  The contributions from Shelia Edwards received on 10/8/02 and
    Brian O. Jordan received on 10/9/02 were refunded on 11/25/02.  The refunds are
    reported on the Committee's 30-Day Post-General Election report.  Commission regulations
    permit a committee 60 days to seek redesignation of a contribution."
